import React from "react";
import { Link, Outlet } from "react-router-dom";

import { Wrapper, Logga } from './Form.styles.js';
import SignOut from "../Logout/index.js";


const Header = () => {

    var aValue = localStorage.getItem('user');
    console.log(aValue)
    //aValue = JSON.parse(aValue)

    return (
            <Wrapper>
                <Logga> Svenska Elsparkcyklar // LOGGA ? </Logga>
                <SignOut></SignOut>

                    <nav
                    style={{
                        borderBottom: "solid 1px",
                        paddingBottom: "1rem"
                    }}

                    >
                    <Link to="/invoices">Historik </Link> |{" "} {/* Link som global navigation */}
                    <Link to="/expenses">Konto</Link>
                    </nav>
                    <Outlet/> {/* outlet renderar child  */}

            </Wrapper>
    )
}

export default Header
